      <table className="table">
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">Name</th>
            {/* <th scope="col">Email</th> */}
            <th scope="col">Brand</th>
            <th scope="col">Model</th>
            <th scope="col">Comment</th>
          </tr>
        </thead>
        <tbody>
          {tableData.map((item) => (
            <tr>
              <th scope="row">{item.id}</th>
              <td>
                {item.firstName} {item.lastName}
              </td>
              {/* <td>{item.email}</td> */}
              <td>{item.carBrand}</td>
              <td>{item.carModel}</td>
              <td>{item.comment}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
